import styles from "./Indones.module.css"

function Indonesia(props) {

    return (
        <div className={styles.container}>
            <section className={styles.card}>
            <h2 className={styles.form__title}>Form Covid</h2>
            </section>
        </div>
    )
}


export default Indonesia;
